import React from 'react';
import {Navbar,Nav,Container} from 'react-bootstrap';

const navbar = () => {
  return (
    <div className='bg-dark'>
      
      <Navbar  expand="lg" className="bg-body-tertiary">
        <Container>
          
        </Container>
        <li>
            Home
        </li>
        <li>
            ABOUT
        </li>
        <li>
            CONTACT
        </li>
      </Navbar>
    </div>
  )
}

export default navbar;
